import React from "react";
import { Link } from "react-router-dom";

function SideBar() {
  return (
    <div className="bg-[#4F46E5] w-[20em]">
      <ol className="">
        <Link to={"dashboard"}>
          <li>Dashboard</li>
        </Link>
        <Link to={"addDocket"}>
          <li>Add Docket</li>
        </Link>
      </ol>
    </div>
  );
}

export default SideBar;
